import ReactDOM from "react";
import { createElement } from "react";
import Class from './newClass'

function registeredDetails({ reg }) {
    return (
        <div>
            <p>{reg.name}</p>
            <p>{reg.email}</p>
            <p>{reg.gender}</p>
            <p>{reg.skills}</p>
        </div>
    )
  }
export default registeredDetails
